var provinces = [];
areaData.RECORDS.forEach(function(x, y, z) {
	if (x.ParentID == "100000"){
		provinces.push({"id":x.RegionID,"value":x.RegionName,"parentId":x.ParentID});
	} 
});

var citys = [];
areaData.RECORDS.forEach(function(x, y, z) {
	provinces.map(function(m, n) {
		return m.id;
	}).forEach(function(u,v) {
		if (x.ParentID == u) {
			citys.push({"id":x.RegionID,"value":x.RegionName,"parentId":x.ParentID});
		};
	})
});

var countys = [];
areaData.RECORDS.forEach(function(x, y, z) {
	citys.map(function(m, n) {
		return m.id;
	}).forEach(function(u,v) {
		if (x.ParentID == u) {
			countys.push({"id":x.RegionID,"value":x.RegionName,"parentId":x.ParentID});
		};
	})
});

